import React from 'react';
/* import { Switch, Route } from 'react-router-dom'; */
import './App.css';

class App extends React.Component {
  render() {
    return (
    <Switch>
      <Route exact path="/" component={ Login } />
      <Route path="/carteira" component={ Wallet } />
    </Switch>)
  }
}

export default App;
